import React from 'react';
import './Academics.css';
import img1 from '../../images/three.jpeg';
import img2 from '../../images/four.jpeg';
import img3 from '../../images/five.jpeg';
import img4 from '../../images/six.jpeg';
export default function Academics(){
    return(
        <>
        <div className="a" id='a'>
            <h1 className="a-head">Academics</h1>
             <div className="a-wrapper">
                <img src={img1} alt="" />
                <img src={img2} alt="" />
                <img src={img3} alt="" />
                <img src={img4} alt="" />
             </div>
        </div>
        </>
    )
}
